function Home() {
  return (
    <div>
      <div>
        <img src="https://t4.ftcdn.net/jpg/07/86/73/57/360_F_786735711_1YqTLECmhneN21SzmsY4Za416j1FtqfC.jpg" alt="Description of image" />
      </div>
    </div>
  );
}

export default Home;
